css:
@-moz-document url-prefix("https://www.roblox.com/games/"), url-prefix("https://web.roblox.com/games/") {
.btn-common-play-game-lg:first-child {
    background: url(data:image/png;base64,) no-repeat;
    border: 0px!important;
    height: 48px!important;
    width: 250px!important;
}
.btn-common-play-game-lg:first-child:hover {
    background-color: transparent;
}
.game-main-content .game-play-buttons .btn-common-play-game-lg {
    min-width: 0px;
    padding: 0px;
}
.btn-common-play-game-lg:first-child .icon-common-play {
    display: none;
}
}
